import Data from './data.json';
import Navbar from './components/Navbar';
import Product from './components/Product';

function App() {
  const renderedItems = Data.map(item => {
    return(
      <Product 
        imgUrl={item.imageUrl}
        name={item.name}
        description
      />
    )
  })
  return(
    <div>
      <Navbar />
    </div>
  )
}

export default App;
